Simple 8Ball Command
```
const Discord = require("discord.js")

module.exports = {
    name:"8ball",

    run: async(client,message,args) => {


        if(!args[0]) return message.channel.send(":x: You must enter an ask")
        if(args[0].length < 1) return message.channel.send(":x: You must enter an ask")


        let i = ["Yes","No","Maybe","Maybe not"]

        let y = i[Math.floor(i.length * Math.random())]


        message.channel.send(`:8ball: ${y}`)
    }
}
```

This is a js bin command
```
const { Client, Message, MessageEmbed } = require("discord.js");
const messagae = require("discord.js");
const { create } = require("sourcebin");
module.exports = {
  name: "jsbin",
  aliases: ["jssourcebin"],
  description: "Make a bin from your javascript code!",
  usage: `rex jsbin <text>`,
  timeout: 4000,
  /**
   * @param {Client} client
   * @param {Message} message
   * @param {String[]} args
   */
  run: async (client, message, args) => {
    const content = args.join(" ");
    if (!content)
      return message.reply(
        new MessageEmbed()
          .setDescription(
            ":FHT_Cross: plese provide content to make a bin out of it!"
          )
          .setColor("#303136")
      );

    create(
      [
        {
          name: `Code by ${message.author.tag}`,
          content,
          language: "javascript",
        },
      ],
      {
        title: "Javascript code",
      }
    ).then((value) => {
      message.reply(
        `:FHT_Correct: I have created  a bin for javascript: ${value.url}`
      );
    });
  },
};
```
